int gen_tables(entry,f,header,output_format)
struct iso_byte_defs	*entry;
FILE	*f;
FILE	*header;
int	output_format;
{
    int i,j;
    skf_ucode *dumpedtbl;
    unsigned short *utable;
    unsigned short uc;
    skf_ucode luc;
    unsigned long kana;
#if defined(DYNAMIC_LOADING) && !defined(SWIG_EXT)
    int	mb_cur_max,mb_cur_min;
    char *uconv_class;
#endif

    if (((entry->unitbl) == NULL) && ((entry->uniltbl) == NULL)) return(0);
    if ((entry->cname) == NULL) return(0);
    kana = entry->is_kana;
    if (is_tblshort(entry->char_width)) {	/* UCS2	*/
	utable = entry->unitbl;
#if !defined(DYNAMIC_LOADING) || defined(SWIG_EXT)
	/* header generation */
	fprintf(header,"\nunsigned short %s_uni_byte[%d] = {\n",
		entry->cname,entry->table_len);
#else
	if (output_format == FORMAT_SKF) {
	    fprintf(header,"\n#define %s_uni_byte\tNULL",entry->cname);
	    fprintf(f,"skf_ctable20");
	} else if (output_format == FORMAT_ICU) {
	    if (is_multibyte(entry->char_width)) {
		mb_cur_max = 2;
		mb_cur_min = 2;
		uconv_class = "MBCS";
	    } else {
		mb_cur_max = 1;
		mb_cur_min = 1;
		uconv_class = "SBCS";
	    };
	    fprintf(header,"<code_set_name>\t\"%s\"\n",entry->cname);
	    fprintf(header,"<char_name_mask>\t\"AXXXX\"\n");
	    fprintf(header,"<mb_cur_max>\t%01d\n",mb_cur_max);
	    fprintf(header,"<mb_cur_min>\t%01d\n",mb_cur_min);
	    fprintf(header,"<uconv_class>\t\"%s\"\n",uconv_class);
	    fprintf(header,"<subchar>\t\\x3F\n");
	    fprintf(header,"#\nCHARMAP\n#\n#\n#10646  %s\n#------ -----\n",
		entry->cname);
	} else if (output_format == FORMAT_CITRUS) {
	    fprintf(stderr,"Sorry, CITRUS format is not yet supported.");
	    return(0);
	} else if (output_format == FORMAT_GNU) {
	    fprintf(stderr,"Sorry, GNU LIBC format is not yet supported.");
	    return(0);
	} else if (output_format == FORMAT_MOZ) {
	    fprintf(stderr,"Sorry, MOZILLA format is not yet supported.");
	    return(0);
	} else;
#endif
	for (i=0;i<entry->table_len;i++) {
	    if (!is_tbl_iso(kana)) {
		j = i;
		uc = utable[j];
		if (entry->defschar == 'i') {  /* cp943 */
		    switch (j) {
			case 0x1c: uc = 0x2014; break;
			case 0x50: uc = 0xffe0; break;
			case 0x51: uc = 0xffe1; break;
			case 0x89: uc = 0xffe2; break;
			default: break;
		    };
		} else if (entry->defschar == 'b') { /* cp932 */
		    ;	/* do nothing */
		};
	    } else {
		uc = utable[i];
	    };
#if !defined(DYNAMIC_LOADING) || defined(SWIG_EXT)
	    fprintf(header,"0x%04x",uc);
	    if (i < (entry->table_len - 1)) {
		putc(',',header);
	    } else {
		fprintf(header,"\n};\n\n");
	    };
	    if ((i & 0x07) == 0x07) putc('\n',header);
#else
	if (output_format == FORMAT_SKF) {
	    putc((uc >> 8) & 0xff,f);
	    putc(uc & 0xff,f);
	} else if (output_format == FORMAT_ICU) {
	    fprintf(header,"<U%04x> ",uc);

	} else if (output_format == FORMAT_CITRUS) {
	} else ;
#endif
	};
    } else if (is_tbllong(entry->char_width)) {  /* UTF-32 and !UCS2 */
	dumpedtbl = entry->uniltbl;
#if !defined(DYNAMIC_LOADING) || defined(SWIG_EXT)
	/* header generation */
	fprintf(stderr,"\n generating %s",entry->cname); (void)fflush(stderr);
	fprintf(header,"\nskf_ucode %s_uni_byte[%d] = {\n",
		entry->cname,entry->table_len);
#else
	if (entry->cname != NULL) {
	    fprintf(header,"\n#define %s_uni_byte\tNULL",entry->cname);
	} else;
	fprintf(f,"skf_ctable40");
#endif
	for (i=0;i<entry->table_len;i++) {
	    luc = dumpedtbl[i];
#if !defined(DYNAMIC_LOADING) || defined(SWIG_EXT)
	    fprintf(header,"0x%08x",luc);
	    if (i < (entry->table_len - 1)) {
		putc(',',header);
	    } else {
		fprintf(header,"\n};\n\n");
	    };
	    if ((i & 0x07) == 0x07) putc('\n',header);
#else
	    putc((luc >> 24) & 0xffU,f);
	    putc((luc >> 16) & 0xffU,f);
	    putc((luc >> 8) & 0xffU,f);
	    putc(luc & 0xffU,f);
#endif
	};
    };
    if (output_format == FORMAT_ICU) {
	fprintf(header,"#\nEND CHARMAP\n#\n#\n");
    } else if (output_format == FORMAT_ICU) {
	;
    } else {
	fprintf(header,"\n");
    };
    return(0);
}

