void read_fix_table(fixt)
long	*fixt;
{
    long	fixb;
    unsigned short fixu;

    while (*fixt > 0) {
	fixb = *(fixt++); fixu = (unsigned short) (*(fixt++));
	set_out_table(fixb,fixu);
    };
}
