void hku_table_gen()
{
    long j,iup,idn,ic;
#ifdef	SKFDEBUG
    if (is_vv_debug) fprintf(stderr," hku_table_gen ");
#endif
/* BIG5 HKU */
    for (j=0; j < BIG5_TBL_LEN; j++) {
	iup = (j / 190); idn = (j % 190);
	if (iup >= (0xc9 - 0xa1)) {
	    ic = ((iup - 3) * 190) +
		  (((idn >= 0x60) && (idn <= 0x7d)) ?
			(idn - 0x61 + 0xa0) : 0) +
		  (((idn >= 0x00) && (idn <= 0x3e)) ?
			(idn + 0x60) : 0) +
		  (((idn >= 0x7e) && (idn <= 0xbd)) ? 
 			(idn - 0x61 + 0xa0) : 0); 
	    if (ic >= BIG5_TBL_LEN) ic = 0;
	} else ic = j;
	if (((idn >= 0x00) && (idn <= 0x3e)) ||
		((idn >= 0x60) && (idn <= 0xbd))) {
	    big5h_uni_byte[ic]= big5_uni_byte[j];
	};
    };
}
