void big5p_table_gen()
{
    long j,k;
#ifdef	SKFDEBUG
    if (is_vv_debug) fprintf(stderr," big5p_table_gen ");
#endif
/* generate big5-plus(big5 + hkscs) */
    for (j=0;j< BIG5_TBL_LEN;j++) { /* skip 0x8140-0xa0fe */
    	big5p_uni_byte[BIG5_OFFSET+j] = big5_uni_byte[j];
    };
    /* fill up 0x8140 - 0x84fe */
    for (j=0;j<4; j++) {
	for (k=0;k<190;k++) {
	    if (k == 0x3f) { k = 0x5f; continue; };
	    big5p_uni_byte[(j * 190) + k] =
		(skf_ucode) (0xeeb8 + (j * (190 - 33)) + k
				- ((k >= 0x60) ? 33 : 0));
	};
    };
    /* fill up 0x8540 - 0x87fe: by 0 */
    for (j=4;j<7; j++) {
	for (k=0;k<190;k++) {
	    if (k == 0x3f) { k = 0x5f; continue; };
	    big5p_uni_byte[(j * 190) + k] = 0;
	};
    };
    for (j=0;j<HKSCS_88_LEN;j++) {  /* 8840 - */
    	big5p_uni_byte[j+1330] = hkscs_88_uni_byte[j];
    };
    for (j=0;j<HKSCS_FA_LEN;j++) {  /* fa40 - */
    	if (hkscs_fa_uni_byte[j] != 0) 
	    big5p_uni_byte[21470+j+1330] = hkscs_fa_uni_byte[j];
    };
    for (j=0;j<HKSCS_C6_LEN;j++) {  /* c640 - */
    	if (hkscs_c6_uni_byte[j] != 0) 
	    big5p_uni_byte[11780+j+1330] = hkscs_c6_uni_byte[j];
    };
}
