/* --------------------------------------------------------------- */
void gbk_table_gen()
{
    long j;
    unsigned int ic;
    long		iup,idn;
    long		dc;

#ifdef	SKFDEBUG
    if (is_vv_debug) fprintf(stderr," gbk_table_gen ");
#endif
/* gbk table generation */
    for (j=0;j<GBK_TBL_LEN;j++) {
	gbk_uni_byte[j] = 0;	/* cleanup			   */
    };
/* gbk unuse map generation */
    for (j=0;j<0x5200;j++) {
	gbk_gen_map[j] = 0;
    };

    for (j=0;j<ISOMB_CODE_END;j++) {
	iup = (j / 94); idn = (j % 94);
	ic = (unsigned int)
		(((iup - 0x81 + 0xa1) * 190) + (idn + 0xa1 - 0x41));
	gbk_uni_byte[ic] = uni_t_gb2312[j];
	if ((uni_t_gb2312[j] >= 0x4e00) && (uni_t_gb2312[j]<0xa000)) {
	    gbk_gen_map[uni_t_gb2312[j] - 0x4e00] = 1;
	};
    };
    ic = 0; iup = 0xaa; idn = 0;
    for (j=0x4e00;j<=0x9fa5;j++) {
	if (ic < GBK_3_LEN) {	/* area GBK/3			   */
	    if (gbk_gen_map[j - 0x4e00] == 0) {
		gbk_uni_byte[ic++] = (unsigned short)j;
	    };
	} else {
	    dc = ((iup - 0x81) * 190) + idn + 0x00;
	    if (gbk_gen_map[j - 0x4e00] == 0) {
		gbk_uni_byte[dc] = (unsigned short)j; idn++;
	    };
	    if (idn >= 0x60) {
		idn = 0; iup++;
	    };
	};
    };
    /* --- fill private area --- */
    ic = 0xe000;
    for (iup = 0xaa;iup<0xb0;iup++) {
	for (idn = (0xa1 - 1); idn < 0xfe; idn++,ic++) {
	    dc = ((iup - 0x81)*190) + (idn - 0x40);
	    gbk_uni_byte[dc] = (unsigned short)ic;
	};
    };
    ic = 0xe4c6;
    for (iup = 0xa1;iup<=0xa7;iup++) {
	for (idn = 0x40; idn < 0xa1; idn++) {
	    if (idn == 0x7f) continue;
	    dc = ((iup - 0x81)*190) + (idn - 0x40) 
			- ((idn > 0x7f) ? 1 : 0);
	    gbk_uni_byte[dc] = (unsigned short)(ic++);
	};
    };
    ic = 0xe234;
    for (iup = 0xf8;iup<0xfe;iup++) {
	for (idn = (0xa1 - 1); idn < 0xfe; idn++,ic++) {
	    dc = ((iup - 0x81)*190) + (idn - 0x40);
	    gbk_uni_byte[dc] = (unsigned short)ic;
	};
    };
    ic = 0xe810;
    for (idn = (0xfa - 1); idn < 0xfe; idn++,ic++) {
	dc = ((0xd7 - 0x81)*190) + (idn - 0x40);
	gbk_uni_byte[dc] = (unsigned short)ic;
    };
    /* --- compat fill --- */
    gbk_uni_byte[6179] = 0x00b7;
    iup = 0xfd; idn = 0x9c - 1;
    for (j=0;;j++) {
    	if (gbk_compat[j] == 0xffff) break;
	dc = ((iup - 0x81)*190) + (idn - 0x40);
	gbk_uni_byte[dc] = gbk_compat[j]; 
	idn ++; if (idn == 0xfe) { iup++; idn = 0x40;};
    };
    iup = 0xa6; idn = 56;
    for (j=0;j<0x26;j++) {	/* vertical character patch */
	dc = ((iup - 0x81) * 190) + idn + 0xa1 - 0x40 - 1 + j;
	gbk_uni_byte[dc] = gbk_vert_patch[j];
    };
    iup = 0xa2; idn = 0;
    for (j=0;j<12;j++) {	/* latin patch */
	dc = ((iup - 0x81) * 190) + idn + 0xa1 - 0x40 - 1 + j;
	gbk_uni_byte[dc] = (unsigned short)(0x2170 + j);
    };
    for (j=0;;j+=2) {	/* read patch table */
    	if (gbk_cjk_a_patch[j] == 0) break;
    	iup = (gbk_cjk_a_patch[j+1] >> 8) & 0xff;
    	idn = gbk_cjk_a_patch[j+1] & 0xff;
	dc = ((iup - 0x81) * 190) + idn - 0x40 - ((idn > 0x7e) ? 1:0);
	gbk_uni_byte[dc] = gbk_cjk_a_patch[j];
    };

}

