void arib_bmp_setpriv(tbl)
skf_ucode *tbl;
{
    int i;
    skf_ucode val;
    
    for (i=0; i<6144;i++) tbl[i] = 0;	/* clear */

    for (i=0;i<188;i++) {
    	/* arib_x213_85 has private area, and 
		arib_kanji_t_tbl has true names. */
    	val = arib_x213_85p[i];
	if ((val >= 0xe000) && (val < 0xf800)) {
	    tbl[val - 0xe000] = arib_kanji_t_tbl[i];
	} else;
    };
    for (i=0;i<470;i++) {
    	val = arib_x213_90p[i];
	if ((val >= 0xe000) && (val < 0xf800)) {
	    tbl[val - 0xe000] = arib_graph_t_tbl[i];
	} else;
    };
}

