void arib_bmp1_gen()
{
    int i;
    int pg,col;
    skf_ucode val;

    arib_bmp_settbl();

    i=0;	/* apply fig7-20 patches */
    while ((pg = arib_bmp_7_20_tbl[i]) != 0) {
        col = arib_bmp_7_20_tbl[i+1];
        val = arib_bmp_7_20_tbl[i+2];
        if ((pg >= 85) && (pg <= 86)) {
	    arib_x213_85p[(pg - 85)*94 + col - 1] = val;
	} else if ((pg >= 0x90) && (pg <= 0x94)) {
	    arib_x213_90p[(pg - 90)*94 + col - 1] = val;
	} else;
	i += 3;
    };

    arib_bmp_setpriv(arib_bmp1_unipriv);
}

