void emoticon_otbl_gen(m)
int m;
{
    int i;
    skf_ucode ch;
    int cup,clow,c3;
    skf_ucode uch;
    int up,low;

    for (i=0;i<NOTE_TABLE_LEN;i++) {
    	o_note_tbl[i] = 0;
    };

    emoticon_table_gen();

    for (i=0; uni_map_emoticon[i] != 0;i += 4) {
	ch = uni_map_emoticon[i+m];
	if (ch == 0) continue;
	if (ch >= 0xf000) {
	    low = ch & 0xffU; up = (ch >> 8) & 0xffU;
	    cup = (up - 0xf0) * 2;
	    if (low < 0x9f) {
		clow = low - ((low > A_DEL) ? 0x41 : 0x40);
	    } else {
		clow = low - 0x9f; cup++;
	    };
	    c3 = (cup << 8) + clow + 0xa121;
	} else {	/* SJIS code is < 0xf000	   */
	    low = ch & 0xffU; up = (ch >> 8) & 0xffU;
	    cup = up + up -((up <= 0x9f) ? 0x102 : 0x182);
	    if (low < 0x9f) {
		clow = low - ((low > A_DEL) ? 0x41 : 0x40);
	    } else {
		clow = low - 0x9f; cup++;
	    };
	    c3 = (cup << 8) + clow + 0x2121;
	};
	uch = uni_map_emoticon[i];
	set_out_table(uch,c3);
    };
}
